import React, { useState } from 'react';
import Axios from 'axios';
import './card.css';
import {useLocation} from 'react-router-dom';

export default function Card({jobdata}) {
    

    return (

            <div className='cont-card'>
            <div className='card'>
                <div className='headerText'>
                <text className='Titletext'>{jobdata.jobCode} {jobdata.jobTitle}</text>
                <button className='applyBtn'>Apply</button>
                </div>
                <div className='line2'>
                    <div className='jobLocation'><img src='/images/location_on.png'></img><text>{jolocation}</text></div>
                    <div className='jobType'><img src='/images/briefcase-outline.png'></img><text>Full Time</text></div>
                    <div className='jobSalary'><img src='/images/money.png'></img><text>150-180</text></div>
                    <div className='jobCategory'><img src='/images/building.png'></img><text>{jobdata.companyName.toUpperCase()}</text></div>
                </div>
                <div className='jobDescription'>
                    <p>
                    {jobdata.jobDescription}
                    </p>
                </div>
            </div>
        </div>


    );
}
